import React from 'react';

class Navigation extends React.Component {
  render() {

    return (
      <section className="section-Navigation section-bottom">
        <nav>
          <ul>
            <li>
              <Link to="/home">Home</Link>
            </li>
            <li>
              <Link to="/setting">Setting</Link>
            </li>
          </ul>
        </nav>
      </section>
    );

}
}

export default Navigation;
